There's a JVM language out there that initially allowed try-statements without catch or finally clauses, e.g<p><pre><code>    try{
      //for a short time only to decide
    }
</code></pre>
But one of its despots, five years after the language was first released, changed the syntax to make a catch or finally clause compulsory, e.g<p><pre><code>    try{
      //for a short time to decide
    }finally{}
</code></pre>
Because I had used these standalone try-statements a lot, I had to go thru all my code and add empty finally statements to them all.<p>Scala, on the other hand, still allows standalone try-statements. And Scala and C
